import Expenseitem from "./component/Expenseitem";

function App() {
  const expenses = [
    {
      id: 'e1',
      title: 'Toilet Paper',
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: 'e2', title: 'New TV', amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: 'e3',
      title: 'Car Insurance',
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: 'e4',
      title: 'New Desk (Wooden)',
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenseitem title={Expenses[0].title} amount={Expenses[0]} date={Expenses[0]}></Expenseitem>
      <Expenseitem title={Expenses[1].title} amount={Expenses[1]} date={Expenses[1]}></Expenseitem>
      <Expenseitem title={Expenses[2].title} amount={Expenses[2]} date={Expenses[2]}></Expenseitem>
      <Expenseitem title={Expenses[3].title} amount={Expenses[3]} date={Expenses[3]}></Expenseitem>

    </div>
  );
}

export default App;
